import React from 'react';
import styles from './NavBar.module.css'
import {useTranslation} from "react-i18next";
import {Button, Popover} from 'antd';

const NavBar = () => {

    const {t, i18n} = useTranslation();

    const popoverContent = (
        <div>
            {t("languageExactly")}123
        </div>
    );

    return (
        <div className={styles.navbar}>
            <div className={styles.container}>
                <div className={styles.decoration}>{t("bio")}</div>
                <div className={styles.decoration}>{t("petProjects")}</div>
                <div className={styles.decoration}>{t("workHistory")}</div>
                <Popover content={popoverContent}>
                    <div className={styles.decoration}>{t("language")}: {t("languageExactly")}</div>
                </Popover>
                <Popover content={popoverContent} title="Title">
                    <Button type="primary">Hover me</Button>
                </Popover>
            </div>
        </div>
    );
};

export default NavBar;
